// Menu.js
import React from 'react';

const Menu = ({ setSelectedComponent }) => {
    return (
        <div className='menu-container'>
            <button className='button-menu' onClick={() => setSelectedComponent('users')}>Пользователи</button>
            <button className='button-menu' onClick={() => setSelectedComponent('games')}>Игры</button>
            <button className='button-menu' onClick={() => setSelectedComponent('settings')}>Настройки</button>
        </div>
    );
};

export default Menu;
